import React from "react";
import "C:/Users/DELL/Desktop/capston-pr/cv-generator-app-reactjs/frontend/node_modules/bootstrap/dist/css/bootstrap.min.css";
import image from "C:/Users/DELL/Desktop/capston-pr/cv-generator-app-reactjs/frontend/src/components/images/resume-template.jpg";
import Container from 'react-bootstrap/Container';
const Home = () => {
  return (
    <>
      <div  className="container1">
        <h1 style={{ fontWeight: "bold" }}>
          The online resume builder getting folks hired by Wipro, BBC, Google,
          Apple, Tesla.
        </h1>
        
      </div>
      <div  className="container2">
      <h3 style={{ fontWeight: "bold" }}>Build your brand-new resume in as little as 5 minutes.</h3>
      <a href="/form">get started</a>
      <img style={{height:"1000px",width:"800px", float:"right"}} src={image} />
      </div>
      <div style={{ display: 'block',
                  width: 700, padding: 30 }}>
      <h4>React-Bootstrap Container Component</h4>
      <Container
        style={{
          backgroundColor: 'green'
        }}
      >
        <h3>Sample Text, Greetings from GeeksforGeeks</h3>
      </Container>
    </div>
    </>
  );
};

export default Home;
